import React, {useState, useContext} from 'react';
import Button from 'react-bootstrap/Button';

function Asientos(props) {
    const [select, setSelect] = useState({});

    return (<>
        <Button onClick={ () => setSelect(item) } 
        className="amarillos"
        variant="warning">1</Button>    

        <Button onClick={ () => setSelect(item) } 
        className="amarillos"
        variant="warning">2</Button> 

        <Button onClick={ () => setSelect(item) } 
        className="amarillos"
        variant="warning">3</Button> 

        <Button onClick={ () => setSelect(item) } 
        className="amarillos"
        variant="warning">4</Button> 

        <Button onClick={ () => setSelect(item) } 
        className="amarillos"
        variant="warning">5</Button> 

        <Button onClick={ () => setSelect(item) } 
        className="amarillos"
        variant="warning">6</Button> 

        <Button onClick={ () => setSelect(item) } 
        className="amarillos"
        variant="warning">7</Button> 

        <Button onClick={ () => setSelect(item) } 
        className="amarillos"
        variant="warning">8</Button> 

        <Button onClick={ () => setSelect(item) } 
        className="amarillos"
        variant="warning">9</Button> 

        <Button onClick={ () => setSelect(item) } 
        className="amarillos"
        variant="warning">10</Button>

        <Button onClick={ () => setSelect(item) } 
        className="amarillos"
        variant="warning">1</Button>  
        </>
    );
}

export default Asientos;
